import React from "react"; 
import { NavLink } from "react-router-dom";
import '../Header.css'; 

function Header() {
    return (
        <div className="Nav"> 
            <nav className="Nav">
                <div>
                <NavLink className="link" to="/"> Home Page </NavLink>

                <NavLink className="link" to="/hypercar"> Hypercar Page </NavLink>
                <NavLink className="link" to="/sportycar"> Sportcar Page </NavLink>
                <NavLink className="link" to="/mommycar"> Mommy's Car Page </NavLink>  
                </div>
            </nav>
        </div>
    )
}

export default Header;
